  display: flex;
  width: 100%;
  height: 15vh;
  background: #5438dc;
  border: 1px #302080;
  border-style: hidden hidden groove hidden;
`;

const LogoSite = styled.div``;

const Header = () => {
  return <HeaderContainer></HeaderContainer>;
};

export default Header;
